    if ($currentLineNumber -eq 1) { 
        try
        {        
            $global:inputHeaders = $line.Replace(' ', '').ToUpper().Split(",")  -replace '[\W]', ''
            $(IsValidHeaderRow($global:inputHeaders))
             if($global:validHeader -eq $true) {
                Write-Output $(Get-CSVLine($global:inputHeaders))
                return
            } else {
                Write-Host "Invalid Header Row. Please check file content." -ForegroundColor red -BackgroundColor white
                break
            }
        }
        catch
        {
            Write-Output "Something threw an exception"
            Write-Output $_
        }

    }
     if($global:validHeader -eq $true) {
     
