                            $global:ExtTypeSets_endDate2FailedRows += $currentLineNumber
                            $ValidatedDate = $row.$outColumnName 
                        }            
                        
                    }
                    $orderedOutputValues += $ValidatedDate 
                }


                  "_extTypeSets_beginDate3" {
                       if (![string]::IsNullOrWhitespace($row.$outColumnName ))
                        {  
                            $ValidatedDate =  Get-ParsedDate $row.$outColumnName                    
                            # Validation, this is a required field, if empty will be unable to post to ODS.
                            if (!$ValidatedDate) {
                                $passedValidation = $false
                                $validationId = "Invalid_extTypeSets_beginDate3"
                                $global:ExtTypeSets_beginDate3FailedRows += $currentLineNumber
                                $ValidatedDate = $row.$outColumnName 
