                }

                "_extStaffId" {

                 if ([string]::IsNullOrWhitespace($row.$outColumnName ))
                    {      $passedValidation = $false
                            $validationId = "Invalid_extStaffId"
                            $global:ExtStaffIdFailedRows += $currentLineNumber
                    }
                    $orderedOutputValues +=$row.$outColumnName   
                    
                }
                
                Default {
                    # In case of no implementation for custom column add $null output to preserve output format and order
                    #$orderedOutputValues += $null
                    $orderedOutputValues += $row.$outColumnName
                    break;
                }
            }
           
            
        }   

    
    Write-Output $(Get-CSVLine($orderedOutputValues))
    $global:statistics.rowsLoaded ++  
    

    return

     }
}

# end of processing
end {
 if($global:validHeader -eq $false) {
        break
