    [parameter(Mandatory = $true, ValueFromPipeline = $true)][string]$line
)

#####################################################
### Ed-Fi ODS v3+
### Assessment: ELPAC 
### Script: Custom File Processor
#####################################################


# Handle start of processing
begin {
   
   function IsValidHeaderRow($headers) {        
                if ($headers.Length -le 1) {
                    $global:validHeader = $false
                }
            }
 
         function Get-JsonSummary() {
            # Validate evry field to add the errors to the json Object
           if( $global:EmploymentStatusFailedRows.count -gt 0)
           {
                $global:jsonObject.errors.EmploymentStatus = @{
                    ColName = "EmploymentStatus"	
	                Rows = $global:EmploymentStatusFailedRows
                }
           }

           if( $global:HireDateFailedRows.count -gt 0)
           {
                $global:jsonObject.errors.HireDate = @{
                    ColName = "HireDate"	
	                Rows = $global:HireDateFailedRows
                }
           }

            if( $global:EducationOrganizationFailedRows.count -gt 0)
           {
                 $global:jsonObject.errors.EducationOrganization = @{
                    ColName = "EducationOrganization"	
	                Rows = $global:EducationOrganizationFailedRows
                }
           }

            if( $global:StaffFailedRows.count -gt 0)
           {
                $global:jsonObject.errors.Staff = @{
                    ColName = "Staff"	
	                Rows = $global:StaffFailedRows
                }
           }

            if( $global:ExtBeginDate1FailedRows.count -gt 0)
           {
                $global:jsonObject.errors.ExtBeginDate1 = @{
                    ColName = "ExtBeginDate1"	
	                Rows = $global:ExtBeginDate1FailedRows
                }
           }

            if( $global:ExtEndDate1FailedRows.count -gt 0)
           {
                $global:jsonObject.errors.ExtEndDate1 = @{
                    ColName = "ExtEndDate1"	
	                Rows = $global:ExtEndDate1FailedRows
                }
           }
            
           $global:jsonObject.finished = Get-Date -Format "HH:mm:ss"   
        return $global:jsonObject
}
     # Convert an array list of data into a CSV line for output
    function Get-CSVLine($inputData) {
        $ret = ""
        foreach ($cell in $inputData) {
            if ($ret -ne "") { $ret += "," }
            $ret += ('"' + $cell + '"')
        }
        return $ret
    }


    function Get-ParsedDate ($date) {             
        <# 
            .SYNOPSIS
                Parse a date string and returns it in the correct format (yyyy-MM-dd).
    
            .PARAMETER date (required)
                The date string to parse
    
            .OUTPUTS
    
                If parsing fails for any reason then $null is returned, if not the date is returned in the next forma: yyyy-MM-dd
        #>
    
        try {
            
            if (!$date) {
                return
            }   
            
            return  ([datetime]$date.Trim()).ToString("yyyy-MM-dd")  
        }
        catch {
            return $null
        }
    }
    
    # Set up the statistics

    $global:statistics = @{
        "rowsProcessed" = 0
        "rowsLoaded"    = 0
        "validations"   = @{}
        "validationMessage"  = @{}
    }
     # create ordered dictionary
    $global:jsonObject = [ordered]@{
        "started"    = Get-Date -Format "HH:mm:ss"
        "finished"   = ""
        "errors"  = [ordered]@{}
        }
        $global:EmploymentStatusFailedRows= @()
        $global:HireDateFailedRows= @()
        $global:EducationOrganizationFailedRows= @()
        $global:StaffFailedRows= @()
        $global:ExtBeginDate1FailedRows= @()
        $global:ExtEndDate1FailedRows= @()
    # Prepare some other variables
    $currentLineNumber = 0
    $global:inputHeaders = @()
    $global:headersLookup = @{}
    $global:validHeader = $true
    ### Helper functions

    ## ODS functions
    $apiVersion = $DataImport.ApiVersion
}


# Process each individual line of incoming data (the pipeline sends this one line at a time)
process {
    $currentLineNumber += 1
    $global:statistics.rowsProcessed += 1

    # Make sure we got something
    if (!$line) { Write-Error "Line $currentLineNumber does not contain any data"; return }
   $line= $line.Replace("`t", ",") # Convert any TAB delimeter to comma 
    
    # If the first line pick out all of the headers
    if ($currentLineNumber -eq 1) { 
        try
        {        
            $global:inputHeaders = $line.Replace(' ', '').ToUpper().Split(",")  -replace '[\W]', ''
            $(IsValidHeaderRow($global:inputHeaders))
             if($global:validHeader -eq $true) {
                Write-Output $(Get-CSVLine($global:inputHeaders))
                return
            } else {
                Write-Host "Invalid Header Row. Please check file content." -ForegroundColor red -BackgroundColor white
                break
            }
        }
        catch
        {
            Write-Output "Something threw an exception"
            Write-Output $_
        }

    }
     if($global:validHeader -eq $true) {
    $row = $line | ConvertFrom-Csv -Header $global:inputHeaders.Trim()
    $errorInCurrentRow = $false
    $orderedOutputValues = @()       

    # Validation will tell whether or not a record has the required values needed to be posted to ODS, if not valid add line number to show in summary
    $passedValidation = $true
    $validationId = $null
    $validationMessage = $null
    
    # Process custom/computed columns
           
        foreach ($outColumnName in $global:inputHeaders) {
         $ValidatedDate= $null
            #Write-Information $outColumnName
            switch -Exact ($outColumnName) {

               
                "EMPLOYMENTSTATUS" {
                    if ([string]::IsNullOrWhitespace($row.$outColumnName ))
                        {               
                            $passedValidation = $false
                            $validationId = "Invalid_EmploymentStatus"
                            $global:EmploymentStatusFailedRows += $currentLineNumber
                        }
                    $orderedOutputValues +=$row.$outColumnName
                }
                 
                "HIREDATE" {
                 if ([string]::IsNullOrWhitespace($row.$outColumnName ))
                    {               
                        $passedValidation = $false
                        $validationId = "Invalid_HireDate"
                        $global:HireDateFailedRows += $currentLineNumber
                        $ValidatedDate = $row.$outColumnName 
                    }else
                    {
                        $ValidatedDate =  Get-ParsedDate $row.$outColumnName                    
                        # Validation, this is a required field, if empty will be unable to post to ODS.
                        if (!$ValidatedDate) {
                            $passedValidation = $false
                            $validationId = "Invalid_HireDate"
                            $ValidatedDate = $row.$outColumnName
                            $global:HireDateFailedRows += $currentLineNumber
                        }
                    }
                    $orderedOutputValues +=$ValidatedDate                    
                }
                
                 "EDUCATIONORGANIZATION" {
                    if ([string]::IsNullOrWhitespace($row.$outColumnName ))
                    {  
                        $passedValidation = $false
                        $validationId = "Invalid_EducationOrganization"
                        $global:EducationOrganizationFailedRows += $currentLineNumber
                    }
                    $orderedOutputValues += $row.$outColumnName
                   
                }

                 "STAFF" {
                  if ([string]::IsNullOrWhitespace($row.$outColumnName ))
                    {  
                        $passedValidation = $false
                        $validationId = "Invalid_Staff"
                        $validationMessage = "The unique alphanumeric code assigned to a staff is Requiered in the row $currentLineNumber"              
                        $global:StaffFailedRows += $currentLineNumber
                    }
                    $orderedOutputValues +=$row.$outColumnName                   
                }
                	

                "_EXTBEGINDATE1" {
                 if (![string]::IsNullOrWhitespace($row.$outColumnName ))
                    {
                        $ValidatedDate =  Get-ParsedDate $row.$outColumnName                    
                        # Validation, this is a required field, if empty will be unable to post to ODS.
                        if (!$ValidatedDate) {
                            $passedValidation = $false
                            $validationId = "Invalid_extBeginDate1"
                            $global:ExtBeginDate1FailedRows += $currentLineNumber
                            $ValidatedDate = $row.$outColumnName  
                        }
                    }
                    $orderedOutputValues += $ValidatedDate 
                    
                }

                 "_EXTENDDATE1" {
                 if (![string]::IsNullOrWhitespace($row.$outColumnName ))
                    {
                        $ValidatedDate =  Get-ParsedDate $row.$outColumnName                    
                        # Validation, this is a required field, if empty will be unable to post to ODS.
                        if (!$ValidatedDate) {
                            $passedValidation = $false
                            $validationId = "Invalid_extEndDate1"
                            $global:ExtEndDate1FailedRows += $currentLineNumber
                            $ValidatedDate = $row.$outColumnName  
                        }
                    }
                    $orderedOutputValues +=$ValidatedDate
                    
                }
                
                Default {
                    # In case of no implementation for custom column add $null output to preserve output format and order
                    #$orderedOutputValues += $null
                    $orderedOutputValues += $row.$outColumnName
                    break;
                }
            }
           
            
        }   

       
    Write-Output $(Get-CSVLine($orderedOutputValues))
    $global:statistics.rowsLoaded ++  
    

    return
}
}

# end of processing
end {
 if($global:validHeader -eq $false) {
        break
    }

$JsonSummary= Get-JsonSummary |ConvertTo-Json -Depth 3
 $summary += "SUMMARY: `
                    Rows Processed: $($global:statistics.rowsProcessed); `
                    Rows Loaded: $($global:statistics.rowsLoaded); `
                    Details: $($JsonSummary)"
     
     Write-Information "*******$summary*********"

    
}

